def initiate_search_process():   
    global  processes, uniquesearchprocess
    if('BUSCA' not in processes):
        for key_in_listaRELS in listaRELS.keys():
            print(key_in_listaRELS)
        print("Starting search process!")
        uniquesearchprocess = mp.Process(target=process_functions.searchProcess, name="FERA SEARCH Process", args=(result_queue, pathdb, erros_queue,\
                                                                     queuesair, searchqueue, update_queue, listaRELS, listaTERMOS, True,),\
                                         daemon=True)
        processes['BUSCA'] = uniquesearchprocess
        uniquesearchprocess.start() 
    
def initiate_processes():
    global processed_pages, processed_requests, listadeobs, render_process, render_process, render_processxml, uniquesearchprocess, processes, model
    processed_pages = manager.list([None] * minMaxLabels)
    processed_requests = [None] * minMaxLabels
    listadeobs = manager.list()
    #model = Model(os.path.join(utilities_general.get_application_path(), "model", "vosk-model-small-pt-0.3"))
    #model = Model(os.path.join(utilities_general.get_application_path(), "model", "vosk-model-small-pt-0.3"))
    #model
    render_process = mp.Process(target=process_functions.backgroundRendererImage, name="FERA IMAGE Process",\
                                args=(processed_pages, request_queue, response_queue, queuesair, infoLaudo, erros_queue,), daemon=True)
    render_process.start()
    render_processxml = mp.Process(target=process_functions.backgroundRendererXML, name="FERA XML Process",\
                                   args=(request_queuexml, response_queuexml, queuesair, infoLaudo, erros_queue, listadeobs,), daemon=True)
    render_processxml.start() 
    
    processes['Renderização de PDF'] = render_process
    processes['Extração de XML'] = render_processxml

